    public static void DrawString(string text, uint x, uint y, uint color) 
    {
        for (ulong c = 0; c < text.Length; c++)
        {
            var offset = (text[c] & 0xFFUL) * 16UL;

            for (ulong i = 0; i < 16; i++)
                for (ulong j = 0; j < 8; j++)
                    if ((Buffer.Value[offset+i] & (0x80 >> (int)j)) != 0)
                        BGA.DrawPoint((ushort)(x + j + c * 8), (ushort)(y + i), color);
        }
    }
